import React  from 'react';

export default function Cat({catPictureU}) {

	var apiData = getAPIData();

	function getAPIData() {
		let data;
		fetch('https://aws.random.cat/meow')
			.then(res => res.json())
			.then(json => {
				data = json;
			});
		return data;
	}

	return (
		<div>
			{apiData}
		</div>
	)
}
